import React from 'react';
import { LeftbarContainer } from '../topbar/Itemstyles';
import { LibraryItem } from '../topbar/Itemstyles';
import { Title } from '../styles';

const Playlists: React.FC = () => {
  return (
    <LeftbarContainer>
      <Title>PLAYLISTS</Title>
      <LibraryItem> Punk rock</LibraryItem>
      <LibraryItem> Machine gun Kelly</LibraryItem>
      <LibraryItem> Eminem </LibraryItem>
      <LibraryItem> Ed Sheeran</LibraryItem>
      <LibraryItem>Wildways </LibraryItem>
      <LibraryItem>Arcade Fire</LibraryItem>
    </LeftbarContainer>
  );
};

export default Playlists;
